        <h5 class="text-center text-2xl font-semibold">ENVIRONNEMENT</h5>
        <p>
            Au cœur de notre mission réside un profond engagement envers la préservation
             de l'environnement. <br> Nous œuvrons à promouvoir la durabilité à travers des initiatives diverses. Nos actions se concentrent sur la conservation des ressources naturelles, la sensibilisation environnementale, le développement durable, la réduction des déchets, et la création de partenariats communautaires en faveur d'un avenir écologiquement équilibré. Ensemble, construisons un monde où chaque individu, chaque communauté et chaque entreprise contribuent activement à
             la protection de notre planète.  </p>
