        <h5 class="text-center text-2xl font-semibold">FEMME</h5>
        <p>
            Nous sommes déterminés à favoriser l'autonomie et l'égalité des femmes. Notre action vise à éliminer les barrières qui limitent le potentiel des femmes. Nous nous investissons dans des programmes d'éducation, d'autonomisation économique, et de sensibilisation pour combattre les inégalités de genre. <br> En favorisant un environnement inclusif, nous aspirons à créer des opportunités où chaque femme peut réaliser son plein potentiel, contribuer à la société, et inspirer les générations futures. Joignez-vous à nous pour bâtir un monde où l'égalité des sexes est la norme, pas l'exception.     </p>
